import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header id="showcase">
        <div class="showcase-content">
          <h1 class="l-heading">Welcome to The Restaurants</h1>
          <p class="lead">
            The best website to find the best place to eat in Stockholm.
          </p>
          <a href="#restaurants" class="btn">
            See Restaurant
          </a>
        </div>
      </header>

      <div id="restaurants">
        <h1 class="m-heading text-center p-1">List of restaurants</h1>
        <div id="profile"></div>
      </div>
    </div>
  );
}

export default App;
